API.html.body:
Autodata API
Init
autoData.init({
    // settings
});

Settings
{
    attributePrefix: 'data-',
    tms: {
      name: 'gtm',
      parser: function(type, data) {}, // Optional
      enhancer: function (parsedTag) {}, // Optional
      sender: function(enhancedTag) {}, // Optional
    },
    plugins: {

    }
}

name
The TMS name that you want to use
parser
This parsing function will be called whenever a tag is triggered, this is your opportunity to enhance default TMS logic or provide your own one.
This function allows you to add custom data on the already parsed tag. This could have been done by the parsing function but it is done this way in order to seperate the role of each function.
enhancer
This function allows you to add custom data on the already parsed tag. This could have been done by the parsing function but it is done this way in order to seperate the role of each function.
sender
This function allows you to change how parsed and enhanced data is sent to TMS or any tag collector system. For example, when using GTM as TMS, it pushes values in Google's dataLayer object.
autoData.sendPageView
This method needs to be used in an SPA or in a tunnel, where there is no page reload. In this contexte, the goal is to track each views/steps as pageviews (generally called virtual pageviews).
The output sent to TMS is the same than automatic pageviews.
Usage
autoData.sendPageView({
    page: '', // optional
    title: '', // optional
});

Result
{
    "event": "pageview",
    "page": "relative_url",
    "title": "meta_title"
}

autoData.sendVirtualPageView (deprecated)
Usage
autoData.sendVirtualPageView({
    page: '', // optional
    title: '', // optional
});

Result
{
    "event": "virtualpageview",
    "page": "relative_url",
    "title": "meta_title"
}

autoData.sendEvent
This method needs to be used for "functionals tags", when data attributes is not enough and/or if the tag is computed dynamically when user interacts with the website. Also, interacted elements handled in Javascript with a preventDefault needs to be tagged with this method.
The output sent to TMS is the same than automatic tags.
Usage
autoData.sendEvent({
    foo: true,
    bar: false,
    baz: true
});

Result
{
    "event":  "click",
    "foo":    true,
    "bar":    false,
    "baz":    true
}

Event name can be overridden if put in the object passed in parameter.
autoData.sendEvent({
    event:'custom_event'
    foo: true,
    bar: false,
    baz: true
});

Result
{
    "event":  "custom_event",
    "foo":    true,
    "bar":    false,
    "baz":    true
}

plugins/EVENT-TRACKER.html.body:
Event plugin
This plugin is aimed to handle automatically event type tag.
As soon as the user interact with the page (click, touch), the event plugin will see if the element matches the attributes rules and then, send the tag automatically.
Initialization
event plugin needs to be declared to be taken into account by autoData.
autoData.init({
  plugins: {
    eventTracker: {
      // your configuration here
      attributePrefix: '',
      trigger: '',
      attributes: []
      // if not set, default configuration is applied
    }
  }
});

All elements are optional, so event plugin can be declared empty.
autoData.init({
  plugins: {
    eventTracker: {}
  }
});

attributePrefix (optional)
Attribute prefix used to parse attributes of interacted DOM element.
trigger (optional)
Attribute used for DOM selection by the plugin.
attributes (optional)
Set of attributes that should be collected on the trigger element in order to build the tag.
Default configuration
This default configuration is applied if all or part of elements are not set.
{
  attributePrefix: 'data-event-',
  trigger: 'obj',
  attributes: ['act', 'desc', 'val']
}

Targeted DOM element have to carry data attributes, at least trigger attribute


Trigger attribute is required to send tag.
If DOM element doesn't have some awaited data attributes, they aren't added to the tag.
Custom configuration example
{
  attributePrefix: 'my-prefix-',
  trigger: 'trigger',
  attributes: ['val1', 'val2', 'val3','val4','val5']
}






Default object sent to the parser
{
  event: 'click',
  obj:   'interacted object',
  act:   'action',
  desc:  'description',
  val:   'value'
}

Note : prefix is not used to define each key.
Tips
Event name override
By default, an event key with "click" value is added to tag to handle it in tag collector.
It can be overridden by using dedicated data attribute.


Manual tracking
If an event cannot be tracked automatically using data attributes, it can be handled by using a dedicated function from autodata API.
See autoData.sendEvent

plugins/PAGEVIEW-TRACKER.html.body:
Pageview plugin
This plugin is aimed to tag automatically the pageview data.
If set, it will collect all the informations on the html tag added to the page.
Initialization and usage
pageview plugin needs to be declared to be taken into account by autoData.
autoData.init({
  plugins: {
    pageviewTracker: {
      // your configuration here
      attributePrefix: '', //data atrribute prefix as string
      trigger: '', //data attribute name as string without prefix
      attributes: [], //object
      withQueryString: 0, //boolean
      hotReload: 0 //boolean
      // if not set, default configuration is applied
    }
  }
});

All elements are optional, so pageview plugin can be declared empty.
autoData.init({
  plugins: {
    eventTracker: {}
  }
});

attributePrefix (optional)
Attribute prefix used for DOM selection
trigger (optional)
Attribute used for DOM selection by the plugin
attributes (optional)
Set of attributes that should be collected on the trigger element in order
to build the tag
withQueryString (optional)
Specify if you want to include the query string in the page property of the
default pageview
hotReload (WIP)
This feature will listen for url changes by history pushState in order
to send the pageview tag again.
You will need to update the DOM in order to collect the new page information !
Default configuration
{
  attributePrefix: 'data-pageview-',
  trigger: 'page',
  attributes: ['title'],
  withQueryString: true,
  hotReload: false
}

Targeted DOM element have to carry data attributes, at least trigger attribute


NOTE
By default, the "page" and "title" information will be collected from the browser information so the creation of the HTML tag is not mandatory !
{
  page: location.pathname + location.search,
  title: history.state.title || document.title
}

plugins/MEDIA-QUERY-TRACKER.html.body:
Media query plugin
This plugin is aimed to tag the viewport changes on your website.
Initialization and usage
Media query plugin needs to be declared to be taken into account by autoData.
autoData.init({
  plugins: {
    mediaQueryTracker: {
      // your configuration here
    }
  }
});

Default configuration
{
  mediaQueryDefinitions: false,
  mediaQueryChangeTemplate: this.changeTemplate,
  mediaQueryChangeTimeout: 1000
}

mediaQueryDefinitions (mandatory)
Set of media-queries that should be spied by the browser in order to tag it when a change occurs.
The configuration must match the following example :
{
  mediaQueryDefinitions: [
    {
      name: 'Breakpoint',
      dimensionIndex: 1,
      items: [
        {name: 'sm', media: 'all'},
        {name: 'md', media: '(min-width: 30em)'},
        {name: 'lg', media: '(min-width: 48em)'}
      ]
    }
  ]
}

In this case, a tag with the name of "Breakpoint" will be dispatched whenever one of the given mediaQueries in items is active.
mediaQueryChangeTemplate (optional)
Let you define the template for value of the changes, by default it is as follow :
oldValue + ' => ' + newValue

mediaQueryChangeTimeout (optional)
NOTE This value is in milliseconds
The tag will be debounced to this value in order to prevent performance issues when resizing window manually.
It is recommended to set a value around 1 second.

