plugins/JWPLAYER-TRACKER.html.body:
JWPlayer plugin
This plugin is aimed to tag automatically JWPlayer instances.
As soon as a configured event will be fired by JWPlayer, it will be sent to current TMS.
autoData use JWPlayer API to listen player events. 7.10.4+ version of JWPlayer is required to work with autoData.
Initialization and usage
JWPlayer plugin needs to be declared to be taken into account by autoData.
autoData.init({
  plugins: {
    jwplayerTracker: {
      // your configuration here
    }
  }
});

jwplayer('myDiv').setup({
  // jwplayer config
  plugins: {
    autoData: {}, // optional, see "autoDetect" option
  }
});
}

Default configuration
{
  jwplayer: null,
  events: ['play', 'pause', 'time', 'volume', 'fullscreen'],
  autoDetect: false,
}

jwplayer (mandatory)
JWPlayer javascript API
events (optional)
All the events that you want to track (default will be  overridden by new ones)
autoDetect (optional)
This is an experimental feature. This will set "autoData" plugin to JWPlayer's default configuration
in order to catch automatically every instance that is created.
If you don't want to use this option, you just need to specify the "autoData" plugin in the JWPlayer
setup settings.
jwplayer('myDiv').setup({
  // JWPlayer config
  plugins: {
    autoData: {}, // optional, see "autoDetect" option
  }
});
}

DATALAYER.html.body:
Data layer page
autoData has been designed to work with a data layer if needed, which can enhance each tag with shared values, provided in the web page.
Introduction
If some tags on the page needs to be populated with shared datas (like a product id), data layer usage prevents writing these datas in many places.
Basically, data layer is a JSON object. autoData merge the parsed tag with data layer datas or part of it, based on configuration.
Initialization and usage
  my_data_layer = {
    key1: "value1",
    key2: "value2"
  };
  autoData.init({
    tms: {
      //data layer configuration
      enhancer: (tag) => ({
        ...tag,
        // Add all key/value pairs from data layer
        ...my_data_layer,
      })
    }
  });

Result for an basic event
{
    "event":   "click",
    "obj":     "My interacted object",
    "key1":    "value1",
    "key2":    "value2"
}

Note : data layer needs to be instanced and populated before autoData initialization or API usage. Updated values in the data layer are taken into account at each send.
Custom selection
By default, all elements from data layer object are merged to sent tag.
If needed, it is possible to declare a list of elements to extract from data layer before merging it with tag.
Here is an example of key selection on datalayer.
  my_data_layer = {
    key1: "value1",
    key2: "value2",
    key3: "value3"
  };
  autoData.init({
    tms: {
      //data layer configuration
      enhancer: (tag) => {
        switch (tag.event) {
          case 'click':
          case 'pageview':
            return {
              ...tag,
              // Add key1 and key3 from data layer for 'click' or 'pageview' events
              key1: my_data_layer.key1,
              key3: my_data_layer.key3
            }
          }
          default:
            return tag;
        }
      }
    }
  });

Switch usage is just for example, it shows a way to enhance tag on 'click' or 'pageview' name of event. In other cases, the tag is not enhanced.
{
    "event":   "click",
    "obj":     "My interacted object",
    "key1":    "value1",
    "key3":    "value3"
}

dev/TMS.html.body:
TMS - Tag management system
This page is aimed to help you understand how to create a new TMS driver inside the project.
autoData has been designed to work with a TMS, but cutom driver override allows sending data to any data collector with the same logic (parsing, enhancing, sending).
Structure
A TMS is an export of 4 elements.
config
export const config = {
  eventTracker: {
    trigger: 'obj',
    attributes: ['act', 'desc', 'val']
  }
};

This config is plugin-dedicated, it will allow you to set a specific configuration for the plugins.
The rest of the configuration is still on charge of the final user (TMS for example).
parser
export const parser = (type, data = {}) => {
  // TMS parsing logic
};

The parser must return an object representing the final tag that will be sent.
enhancer
export const enhancer = (tag) => {
// TMS enhancing logic
// ...tag, ...window.utag_data
};

The enhancer must return an object representing the enriched final tag provided by parser.
sender
export const sender = (parsedTag) => {
  // TMS sending logic
};

Sender have the parsed tag as an argument and it's in your charge to send it to a TMS or any data collector system.
